import{Tabs,H2,Table,Link} from 'govuk-react';
import { useNavigate } from 'react-router-dom';
import { useParams } from 'react-router-dom';


import { Routes, Route } from "react-router-dom";
import DRTab from './De-Register/DRTab';
import BookTab from './BookAppointment/BookTab';
import ViewTab from './ViewAppointment/ViewTab';
import DoctorTab from './DoctorsAvailable/DoctorTab';

function GPTabs(){
     
    const navigate = useNavigate();
    const {section} = useParams();

    return(
  <div>
  
    <Tabs>
        <Tabs.Title>
            Contents
        </Tabs.Title>
  <Tabs.List>
    <Tabs.Tab as={Link} selected={!section} to="/">
      Doctors at GP
    </Tabs.Tab>
    <Tabs.Tab as={Link} selected={section === 'BookTab'} to="/BookTab">
      Book Appointment
    </Tabs.Tab>
    <Tabs.Tab onClick={() => navigate("/View-or-cancel-appointments")}>
      View/Cancel Appointment
    </Tabs.Tab>
    <Tabs.Tab onClick={() => navigate("/De-register")}>
      De-Register
    </Tabs.Tab>
  </Tabs.List>
 
  <DoctorTab />
  
  <BookTab />

  <ViewTab />

  <DRTab />

</Tabs>

</div>

)};

export default GPTabs;
